import {useState, useEffect} from 'react'
import axios from 'axios'
import bannerService from './banners'
import Nav from './components/Nav'


const App = () => {

  const [sections, setSections] = useState([])

  useEffect(() => {
    bannerService.classSearch(202320, 'ISCO')
      .then(sec => setSections(sec.data.data))
  }, [])

  return(
    <div class='par'>
      <Nav/>
      <ul>
        {sections.map(section => <li>{section}</li>)}
      </ul>
    </div>)
}

export default App;
